}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 40 40">    <path d="M0,3V37H40V3ZM4,36V10H31V36Zm28,0V10h5V36Zm7,0H38V9H3V36H1V4H39Z" class="aw-theme-iconOutline" fill="#464646"/>    <rect x="34" y="6" width="4" height="1" class="aw-theme-iconOutline" fill="#464646"/>    <path d="M6,5H3V8H6ZM5,7H4V6H5Z" class="aw-theme-iconOutline" fill="#464646"/></svg>';
